(5173, 1, '2025-12-11 07:32:17', '2025-12-11 07:32:17', 'Bà Lê Thị Hoài Vinh, Chủ tịch UBND xã Hòa Mỹ (trước đây thuộc Phú Yên, nay thuộc Đắk Lắk), cho biết nước tại khu vực cầu Bến Trâu bắc qua sông Bàn Thạch bắt đầu dâng từ 12h ngày 10/12 và đến chiều cùng ngày đã tràn qua mặt cầu. Địa phương đã đặt biển cảnh báo và chốt chặn hai đầu cầu để đảm bảo an toàn.\r\n\r\n<strong>Hiện tại mực nước đang xuống chậm, địa phương đang theo dõi sát diễn biến thời tiết để có phương án ứng phó</strong>, bà Vinh nói.\r\n<figure><img title=\"Khu vực cầu Bến Trâu nước đã tràn qua mặt cầu từ chiều 10/12.\" src=\"https://cdn-i.vtcnews.vn/resize/th/upload/2025/12/10/ng-19045005.jpg\" alt=\"Khu vực cầu Bến Trâu nước đã tràn qua mặt cầu từ chiều 10/12.\" /><figcaption>Khu vực cầu Bến Trâu nước đã tràn qua mặt cầu từ chiều 10/12.</figcaption></figure>\r\nÔng Tô Văn Giang, Phó Chủ tịch UBND xã Sông Hinh, cho biết do mưa lớn, cầu tràn suối Bệnh viện Sông Hinh (đoạn đầu vào buôn Dành) đã bị ngập. Các khu vực dân cư hiện chưa ghi nhận ngập sâu, hiện mực nước rút chậm.\r\n\r\n<strong>Địa phương đã cắt cử lực lượng chốt chặn hai đầu cầu tràn không cho người qua lại để đảm bảo an toàn</strong>, ông Giang nói.\r\n\r\nTheo người dân, mỗi khi nghe tin mưa lớn họ đều nơm nớp lo âu. Trận lũ lịch sử vừa qua khiến nước dâng quá nhanh, cuốn trôi nhiều tài sản... đến nay việc dọn dẹp, sửa chữa nhà cửa vẫn chưa hoàn tất.\r\n\r\n<em>Nếu lại ngập nữa thì thực sự quá sức chịu đựng</em>, một người dân chia sẻ.\r\n<figure><img title=\"Khu vực cầu suối phía sau Bệnh viện Sông Hinh đã đặt biển cảnh báo.\" src=\"https://cdn-i.vtcnews.vn/resize/th/upload/2025/12/10/ng1-19054262.jpg\" alt=\"Khu vực cầu suối phía sau Bệnh viện Sông Hinh đã đặt biển cảnh báo.\" /><figcaption>Khu vực cầu suối phía sau Bệnh viện Sông Hinh đã đặt biển cảnh báo.</figcaption></figure>\r\nTheo báo cáo ngày 10/12 của Phòng Văn hóa - Xã hội UBND xã Hòa Thịnh về việc điều tiết, tăng lưu lượng qua tràn xả lũ hồ chứa nước Mỹ Lâm (căn cứ Công văn của Công ty TNHH MTV Thủy nông Đồng Cam), mực nước hồ lúc 9h cùng ngày đạt 33,40 m; dung tích 30,82/34,82 triệu m³.\r\n\r\nLưu lượng nước đến hồ hiện tại là 101,4 m³/s và sẽ còn tiếp tục tăng do trên lưu vực hồ chứa nước Mỹ Lâm vẫn đang mưa lớn.\r\n\r\nQua tính toán lưu lượng nước về hồ hiện tại, dự kiến đến 20h ngày 10/12, mực nước hồ chứa nước Mỹ Lâm sẽ đạt mức dâng. Để bảo đảm an toàn hồ chứa và hạ du, đồng thời tránh phải xả đột ngột với lưu lượng lớn, Công ty TNHH MTV Thủy nông Đồng Cam triển khai điều tiết tăng lưu lượng qua tràn theo kế hoạch.\r\n\r\nThời gian bắt đầu điều tiết từ 16h ngày 10/12 đến khi kết thúc đợt mưa. Lưu lượng xả dự kiến từ 30 đến 71 m³/s (tương ứng mở 1 cửa tràn với độ mở 0,5 - 1 m), tùy theo diễn biến mưa và lượng nước về hồ.\r\n\r\nTheo Đài Khí tượng thủy văn tỉnh Đắk Lắk, dự báo từ chiều tối 9/12 đến hết 10/12, trên địa bàn các xã, phường thuộc khu vực phía Đông tỉnh Đắk Lắk sẽ xảy ra một đợt mưa vừa, mưa to, có nơi mưa rất to và dông. Tổng lượng mưa phổ biến từ 50 - 100 mm, có nơi trên 150 mm.\r\n\r\nCụ thể khu vực các xã, phường thuộc Tuy Hòa, Sơn Hòa, Tuy An, Đồng Xuân, Sông Cầu, Krông Bông, M\'Drắk: có tổng lượng mưa từ 50 - 80 mm, có nơi trên 120 mm;\r\n\r\nKhu vực các xã, phường thuộc Sông Hinh, Tây Hòa, Phú Hòa, Đông Hòa có tổng lượng mưa từ 70 - 100 mm, có nơi trên 150 mm.\r\n\r\nTừ ngày 11/12, dự báo cường độ mưa sẽ giảm dần. Trong 48 - 72 giờ tới, khu vực phía Đông tỉnh tiếp tục xuất hiện mưa rào rải rác, với tổng lượng mưa phổ biến dưới 20 mm/24 giờ.\r\n\r\n<strong>Đài Khí tượng Thủy văn tỉnh Đắk Lắk phát cảnh báo rủi ro thiên tai do mưa lớn ở cấp độ 1.</strong> Mưa lớn có thể gây ngập úng tại các khu vực trũng, thấp và ngập cục bộ trong đô thị.\r\n\r\nCơ quan khí tượng lưu ý người dân ở những khu vực địa hình dốc, nền địa chất yếu cần phòng nguy cơ sạt lở đất; đồng thời đề phòng lốc, sét và gió giật mạnh kèm theo trong mưa dông, nhằm bảo đảm an toàn cho người, vật nuôi và tài sản.', 'Mưa lớn gây ngập lụt tại Phú Yên thì người dân cần lưu ý những gì?', 'Mưa lớn kéo dài khiến nước sông dâng cao gây ngập lụt cục bộ tại Đắk Lắk và Phú Yên. Chính quyền địa phương đã triển khai chốt chặn các cầu tràn để đảm bảo an toàn.', 'publish', 'open', 'open', '', 'mua-lon-gay-ngap-lut-tai-phu-yen', '', '', '2025-12-11 07:32:17', '2025-12-11 07:32:17', '', 0, 'http://localhost/tinbmt/?p=5173', 0, 'post', '', 0),
