(5241, 1, '2025-12-15 03:40:46', '2025-12-15 03:40:46', '<h1>Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân</h1>\r\n<figure class=\"VCSortableInPreviewMode alignCenterOverflow\" data-style=\"align-center-overflow\">\r\n<div><a class=\"detail-img-lightbox\" title=\"Sau nhiều ngày thi công liên tục, những căn nhà do Bộ Chỉ huy Quân sự (CHQS) TP Đà Nẵng hỗ trợ xây dựng cho người dân bị thiệt hại do mưa lũ tại Đắk Lắk đang dần hiện rõ vóc dáng vững chãi giữa vùng đất từng oằn mình trong thiên tai.\" href=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/14/nha-1-17657393310651701626847.jpg\" target=\"_blank\" rel=\"noopener\" data-fancybox=\"img-lightbox\"><img id=\"img_195471391640199168\" class=\"lightbox-content\" style=\"max-width: 100%;\" title=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 1.\" src=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/14/nha-1-17657393310651701626847.jpg\" alt=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 1.\" width=\"2018\" height=\"1365\" data-author=\"\" data-is-alt-modified=\"true\" /></a></div>\r\n<figcaption class=\"PhotoCMS_Caption\">\r\n<p class=\"NLPlaceholderShow\" data-placeholder=\"Nhập chú thích ảnh\">Sau nhiều ngày thi công liên tục, những căn nhà do Bộ Chỉ huy Quân sự (CHQS) TP Đà Nẵng hỗ trợ xây dựng cho người dân bị thiệt hại do mưa lũ tại Đắk Lắk đang dần hiện rõ vóc dáng vững chãi giữa vùng đất từng oằn mình trong thiên tai.</p>\r\n\r\n</figcaption></figure>\r\n<figure class=\"VCSortableInPreviewMode alignCenterOverflow\" data-style=\"align-center-overflow\">\r\n<div><a class=\"detail-img-lightbox\" title=\"Trên các công trình, những tổ đội thi công đồng loạt lên tường, đổ mê, hoàn thiện gác lửng tầng 2.\" href=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/14/nha-2-1765739331157197965096.jpg\" target=\"_blank\" rel=\"noopener\" data-fancybox=\"img-lightbox\"><img id=\"img_195471391732473856\" class=\"lightbox-content\" style=\"max-width: 100%;\" title=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 2.\" src=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/14/nha-2-1765739331157197965096.jpg\" alt=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 2.\" width=\"2048\" height=\"1365\" data-author=\"\" data-is-alt-modified=\"true\" /></a></div>\r\n<figcaption class=\"PhotoCMS_Caption\">\r\n<p class=\"NLPlaceholderShow\" data-placeholder=\"Nhập chú thích ảnh\">Trên các công trình, những tổ đội thi công đồng loạt lên tường, đổ mê, hoàn thiện gác lửng tầng 2.</p>\r\n\r\n</figcaption></figure>\r\n<figure class=\"VCSortableInPreviewMode alignCenterOverflow\" data-style=\"align-center-overflow\">\r\n<div><a class=\"detail-img-lightbox\" title=\"Từng hạng mục được triển khai đúng thiết kế kỹ thuật, bảo đảm chất lượng và an toàn. Không khí lao động khẩn trương, nhịp nhàng, mỗi người một việc, tất cả cùng chung quyết tâm rút ngắn thời gian để sớm trao lại mái ấm cho bà con.\" href=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/14/nha-3-1765739331188288713439.jpg\" target=\"_blank\" rel=\"noopener\" data-fancybox=\"img-lightbox\"><img id=\"img_195471391723384832\" class=\"lightbox-content\" style=\"max-width: 100%;\" title=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 3.\" src=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/14/nha-3-1765739331188288713439.jpg\" alt=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 3.\" width=\"2048\" height=\"1365\" data-author=\"\" data-is-alt-modified=\"true\" /></a></div>\r\n<figcaption class=\"PhotoCMS_Caption\">\r\n<p class=\"NLPlaceholderShow\" data-placeholder=\"Nhập chú thích ảnh\">Từng hạng mục được triển khai đúng thiết kế kỹ thuật, bảo đảm chất lượng và an toàn. Không khí lao động khẩn trương, nhịp nhàng, mỗi người một việc, tất cả cùng chung quyết tâm rút ngắn thời gian để sớm trao lại mái ấm cho bà con.</p>\r\n\r\n</figcaption></figure>\r\nHiện nay, <strong>Bộ Chỉ huy Quân sự (CHQS) TP Đà Nẵng</strong> đang trực tiếp tổ chức xây mới 5 căn nhà cho các hộ dân chịu ảnh hưởng nặng nề bởi mưa lũ. Song song với công tác thi công, đơn vị tiếp tục phối hợp chặt chẽ với chính quyền địa phương và các lực lượng liên quan để tháo gỡ khó khăn, bảo đảm tiến độ chung của chiến dịch.\r\n<figure class=\"VCSortableInPreviewMode alignCenterOverflow\" data-style=\"align-center-overflow\">\r\n<div><a class=\"detail-img-lightbox\" title=\"Hiện nay, Bộ CHQS TP Đà Nẵng đang trực tiếp tổ chức xây mới 5 căn nhà cho các hộ dân chịu ảnh hưởng nặng nề bởi mưa lũ.\" href=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/14/nha-4-1765739331194365897184.jpg\" target=\"_blank\" rel=\"noopener\" data-fancybox=\"img-lightbox\"><img id=\"img_195471391694024704\" class=\"lightbox-content\" style=\"max-width: 100%;\" title=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 4.\" src=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/14/nha-4-1765739331194365897184.jpg\" alt=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 4.\" width=\"2048\" height=\"1365\" data-author=\"\" data-is-alt-modified=\"true\" /></a></div>\r\n<figcaption class=\"PhotoCMS_Caption\">\r\n<p class=\"NLPlaceholderShow\" data-placeholder=\"Nhập chú thích ảnh\">Hiện nay, Bộ CHQS TP Đà Nẵng đang trực tiếp tổ chức xây mới 5 căn nhà cho các hộ dân chịu ảnh hưởng nặng nề bởi mưa lũ.</p>\r\n\r\n</figcaption></figure>\r\n<figure class=\"VCSortableInPreviewMode alignCenterOverflow\" data-style=\"align-center-overflow\">\r\n<div><a class=\"detail-img-lightbox\" title=\"Song song với công tác thi công, đơn vị tiếp tục phối hợp chặt chẽ với chính quyền địa phương và các lực lượng liên quan để tháo gỡ khó khăn, bảo đảm tiến độ chung của chiến dịch.\" href=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/14/nha-5-17657393312381989439718.jpg\" target=\"_blank\" rel=\"noopener\" data-fancybox=\"img-lightbox\"><img id=\"img_195471388384718848\" class=\"lightbox-content\" style=\"max-width: 100%;\" title=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 5.\" src=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/14/nha-5-17657393312381989439718.jpg\" alt=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 5.\" width=\"2048\" height=\"1365\" data-author=\"\" data-is-alt-modified=\"true\" /></a></div>\r\n<figcaption class=\"PhotoCMS_Caption\">\r\n<p class=\"NLPlaceholderShow\" data-placeholder=\"Nhập chú thích ảnh\">Song song với công tác thi công, đơn vị tiếp tục phối hợp chặt chẽ với chính quyền địa phương và các lực lượng liên quan để tháo gỡ khó khăn, bảo đảm tiến độ chung của chiến dịch.</p>\r\n\r\n</figcaption></figure>\r\nNhững bức tường mới dựng, những khung nhà dần hoàn thiện không chỉ là kết quả của mồ hôi, công sức mà còn là minh chứng sinh động cho tình <strong>quân – dân bền chặt</strong>, ý chí vượt khó và tinh thần trách nhiệm của lực lượng vũ trang TP Đà Nẵng trên hành trình giúp người dân sớm ổn định cuộc sống, hướng tới một cái Tết ấm áp, đủ đầy.\r\n<figure class=\"VCSortableInPreviewMode alignCenterOverflow\" data-style=\"align-center-overflow\">\r\n<div><a class=\"detail-img-lightbox\" title=\"Những bức tường mới dựng, những khung nhà dần hoàn thiện không chỉ là kết quả của mồ hôi, công sức mà còn là minh chứng sinh động cho tình quân – dân bền chặt, ý chí vượt khó và tinh thần trách nhiệm của lực lượng vũ trang TP Đà Nẵng trên hành trình giúp người dân sớm ổn định cuộc sống, hướng tới một cái Tết ấm áp, đủ đầy.\" href=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/14/nha-6-17657393312801486442634.jpg\" target=\"_blank\" rel=\"noopener\" data-fancybox=\"img-lightbox\"><img id=\"img_195471390312001536\" class=\"lightbox-content\" style=\"max-width: 100%;\" title=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 6.\" src=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/14/nha-6-17657393312801486442634.jpg\" alt=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 6.\" width=\"2048\" height=\"1365\" data-author=\"\" data-is-alt-modified=\"true\" /></a></div>\r\n<figcaption class=\"PhotoCMS_Caption\">\r\n<p class=\"NLPlaceholderShow\" data-placeholder=\"Nhập chú thích ảnh\">Những bức tường mới dựng, những khung nhà dần hoàn thiện không chỉ là kết quả của mồ hôi, công sức mà còn là minh chứng sinh động cho tình quân – dân bền chặt, ý chí vượt khó và tinh thần trách nhiệm của lực lượng vũ trang TP Đà Nẵng trên hành trình giúp người dân sớm ổn định cuộc sống, hướng tới một cái Tết ấm áp, đủ đầy.</p>\r\n\r\n</figcaption></figure>\r\nTrước đó, vào ngày 1 và 7/12, Bộ CHQS TP Đà Nẵng đã huy động gần 120 cán bộ, chiến sĩ vào Đắk Lắk thực hiện <strong>“Chiến dịch Quang Trung thần tốc”</strong>, hỗ trợ sửa chữa, dựng lại nhà cửa cho người dân vùng lũ. Lực lượng được lựa chọn đều là những quân nhân có tay nghề tốt trong lĩnh vực xây dựng, sửa chữa nhà ở, từng nhiều lần tham gia các nhiệm vụ giúp người dân khắc phục hậu quả thiên tai.\r\n<figure class=\"VCSortableInPreviewMode alignCenterOverflow\" data-style=\"align-center-overflow\">\r\n<div><a class=\"detail-img-lightbox\" title=\"Trước đó, vào ngày 1 và 7/12, Bộ CHQS TP Đà Nẵng đã huy động gần 120 cán bộ, chiến sĩ vào Đắk Lắk thực hiện “Chiến dịch Quang Trung thần tốc”, hỗ trợ sửa chữa, dựng lại nhà cửa cho người dân vùng lũ.\" href=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/14/nha-7-17657393312994830175.jpg\" target=\"_blank\" rel=\"noopener\" data-fancybox=\"img-lightbox\"><img id=\"img_195471389662654464\" class=\"lightbox-content\" style=\"max-width: 100%;\" title=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 7.\" src=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/14/nha-7-17657393312994830175.jpg\" alt=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 7.\" width=\"2048\" height=\"1365\" data-author=\"\" data-is-alt-modified=\"true\" /></a></div>\r\n<figcaption class=\"PhotoCMS_Caption\">\r\n<p class=\"NLPlaceholderShow\" data-placeholder=\"Nhập chú thích ảnh\">Trước đó, vào ngày 1 và 7/12, Bộ CHQS TP Đà Nẵng đã huy động gần 120 cán bộ, chiến sĩ vào Đắk Lắk thực hiện “Chiến dịch Quang Trung thần tốc”, hỗ trợ sửa chữa, dựng lại nhà cửa cho người dân vùng lũ.</p>\r\n\r\n</figcaption></figure>\r\n<figure class=\"VCSortableInPreviewMode alignCenterOverflow\" data-style=\"align-center-overflow\">\r\n<div><a class=\"detail-img-lightbox\" title=\"Lực lượng được lựa chọn đều là những quân nhân có tay nghề tốt trong lĩnh vực xây dựng, sửa chữa nhà ở, từng nhiều lần tham gia các nhiệm vụ giúp người dân khắc phục hậu quả thiên tai.\" href=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/14/nha-8-17657393313271569742924.jpg\" target=\"_blank\" rel=\"noopener\" data-fancybox=\"img-lightbox\"><img id=\"img_195471391264878592\" class=\"lightbox-content\" style=\"max-width: 100%;\" title=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 8.\" src=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/14/nha-8-17657393313271569742924.jpg\" alt=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 8.\" width=\"2048\" height=\"1365\" data-author=\"\" data-is-alt-modified=\"true\" /></a></div>\r\n<figcaption class=\"PhotoCMS_Caption\">\r\n<p class=\"NLPlaceholderShow\" data-placeholder=\"Nhập chú thích ảnh\">Lực lượng được lựa chọn đều là những quân nhân có tay nghề tốt trong lĩnh vực xây dựng, sửa chữa nhà ở, từng nhiều lần tham gia các nhiệm vụ giúp người dân khắc phục hậu quả thiên tai.</p>\r\n\r\n</figcaption></figure>\r\nNgay sau khi nhận lệnh, các cán bộ, chiến sĩ nhanh chóng cơ động về phường Đông Hòa (Đắk Lắk), mang theo đầy đủ dụng cụ, vật tư cần thiết. Họ chia nhóm, luân phiên làm việc, tranh thủ từng khoảng thời gian thời tiết thuận lợi, nỗ lực đẩy nhanh tiến độ, với mong muốn duy nhất sớm trao lại cho người dân những mái nhà kiên cố, vững vàng sau bão lũ.\r\n<figure class=\"VCSortableInPreviewMode alignCenterOverflow\" data-style=\"align-center-overflow\">\r\n<div><a class=\"detail-img-lightbox\" title=\"Ngay sau khi nhận lệnh, các cán bộ, chiến sĩ nhanh chóng cơ động về phường Đông Hòa (Đắk Lắk), mang theo đầy đủ dụng cụ, vật tư cần thiết.\" href=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/14/nha-9-1765739331381261481463.jpg\" target=\"_blank\" rel=\"noopener\" data-fancybox=\"img-lightbox\"><img id=\"img_195471389523472384\" class=\"lightbox-content\" style=\"max-width: 100%;\" title=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 9.\" src=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/14/nha-9-1765739331381261481463.jpg\" alt=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 9.\" width=\"2048\" height=\"1365\" data-author=\"\" data-is-alt-modified=\"true\" /></a></div>\r\n<figcaption class=\"PhotoCMS_Caption\">\r\n<p class=\"NLPlaceholderShow\" data-placeholder=\"Nhập chú thích ảnh\">Ngay sau khi nhận lệnh, các cán bộ, chiến sĩ nhanh chóng cơ động về phường Đông Hòa (Đắk Lắk), mang theo đầy đủ dụng cụ, vật tư cần thiết.</p>\r\n\r\n</figcaption></figure>\r\n<figure class=\"VCSortableInPreviewMode alignCenterOverflow\" data-style=\"align-center-overflow\">\r\n<div><a class=\"detail-img-lightbox\" title=\"Họ chia nhóm, luân phiên làm việc, tranh thủ từng khoảng thời gian thời tiết thuận lợi, nỗ lực đẩy nhanh tiến độ, với mong muốn duy nhất sớm trao lại cho người dân những mái nhà kiên cố, vững vàng sau bão lũ.\" href=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/14/nha-10-17657393314161579479893.jpg\" target=\"_blank\" rel=\"noopener\" data-fancybox=\"img-lightbox\"><img id=\"img_195471391462281216\" class=\"lightbox-content\" style=\"max-width: 100%;\" title=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 10.\" src=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/14/nha-10-17657393314161579479893.jpg\" alt=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 10.\" width=\"2048\" height=\"1365\" data-author=\"\" data-is-alt-modified=\"true\" /></a></div>\r\n<figcaption class=\"PhotoCMS_Caption\">\r\n<p class=\"NLPlaceholderShow\" data-placeholder=\"Nhập chú thích ảnh\">Họ chia nhóm, luân phiên làm việc, tranh thủ từng khoảng thời gian thời tiết thuận lợi, nỗ lực đẩy nhanh tiến độ, với mong muốn duy nhất sớm trao lại cho người dân những mái nhà kiên cố, vững vàng sau bão lũ.</p>\r\n\r\n</figcaption></figure>\r\n<div class=\"VCSortableInPreviewMode\"><a style=\"padding: 0;\" href=\"/da-nang-tang-quan-vao-dak-lak-chay-dua-hoan-thanh-chien-dich-quang-trung-169251207095523869.htm\"><img title=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 11.\" src=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/7/quan-su-2-1765075862614770697612-0-0-1600-2560-crop-17650760511091486915698.jpg\" alt=\"Đẩy nhanh tiến độ xây dựng, những ngôi nhà kiên cố trong \'Chiến dịch Quang Trung\' sắp được trao tận tay người dân- Ảnh 11.\" width=\"215\" height=\"auto\" data-cke-saved-src=\"https://suckhoedoisong.qltns.mediacdn.vn/324455921873985536/2025/12/7/quan-su-2-1765075862614770697612-0-0-1600-2560-crop-17650760511091486915698.jpg\" data-is-alt-modified=\"true\" /></a><a class=\"OneNewsTitle\" style=\"text-align: left;\" href=\"/da-nang-tang-quan-vao-dak-lak-chay-dua-hoan-thanh-chien-dich-quang-trung-169251207095523869.htm\">Đà Nẵng tăng quân vào Đắk Lắk, chạy đua hoàn thành \'Chiến dịch Quang Trung\'</a>\r\n<p class=\"VCObjectBoxRelatedNewsItemSapo\">SKĐS - Nhằm giúp người dân sớm ổn định cuộc sống, Đà Nẵng tăng cường thêm lực lượng vào Đắk Lắk, đẩy nhanh tiến độ xây dựng nhà cửa cho bà con.</p>\r\n\r\n</div>', 'Chiến dịch Quang Trung xây nhà tình nghĩa vì sao và khi nào sẽ trao tận tay người dân?', 'Những căn nhà kiên cố trong \'Chiến dịch Quang Trung\' do Bộ CHQS TP Đà Nẵng hỗ trợ xây dựng cho người dân vùng lũ Đắk Lắk đang được đẩy nhanh tiến độ hoàn thiện để sớm bàn giao.', 'publish', 'open', 'open', '', 'chien-dich-quang-trung-xay-nha-tinh-nghia-se-trao-tang-khi-nao', '', '', '2025-12-15 03:40:46', '2025-12-15 03:40:46', '', 0, 'http://localhost/tinbmt/?p=5241', 0, 'post', '', 0),
