(5280, 1, '2025-12-16 02:18:14', '2025-12-16 02:18:14', '<h1>Nhật Bản viện trợ 1,5 triệu USD hỗ trợ Việt Nam phục hồi sau thiên tai</h1>\r\nNgày 15-12, Chính phủ Nhật Bản công bố khoản viện trợ trị giá <strong>1,5 triệu USD</strong> thông qua Tổ chức Di cư Quốc tế (IOM) và Quỹ Nhi đồng Liên Hợp Quốc (UNICEF) nhằm hỗ trợ khẩn cấp và phục hồi sau thiên tai tại Việt Nam.\r\n<figure><img title=\"Nhật Bản viện trợ 1 , 5 triệu USD hỗ trợ Việt Nam phục hồi sau thiên tai - Ảnh 1.\" src=\"https://nld.mediacdn.vn/thumb_w/698/291774122806476800/2025/12/15/dsc00881-17657911825521313241316.jpg\" alt=\"Nhật Bản viện trợ 1 , 5 triệu USD hỗ trợ Việt Nam phục hồi sau thiên tai - Ảnh 1.\" width=\"2560\" height=\"1706\" /><figcaption>Ngài Ito Naoki, Đại sứ Nhật Bản, cùng phu nhân và bà Silvia Danailov, Trưởng Đại diện UNICEF, đã đến thăm các hoạt động về nước sạch và vệ sinh tại trường Tiểu học Kim Cúc, tỉnh Cao Bằng. Các hoạt động này do UNICEF và Chính phủ Nhật Bản hỗ trợ, nhằm khắc phục hậu quả sau bão Yagi năm 2024</figcaption></figure>\r\nKhoản hỗ trợ tập trung vào các tỉnh <strong>Đắk Lắk, Gia Lai, Khánh Hòa và Lâm Đồng</strong> - những địa phương chịu thiệt hại nặng nề do chuỗi áp thấp nhiệt đới, bão và lũ lụt xảy ra liên tiếp trong năm 2025. Trong đó, <strong>1 triệu USD</strong> được phân bổ cho IOM để cung cấp hàng phi lương thực cho hơn 32.000 người dân, đồng thời trang bị thiết bị cứu hộ cho 20 đội tìm kiếm, cứu nạn địa phương, hỗ trợ khoảng 4.000 người dân.\r\n\r\nUNICEF sẽ triển khai <strong>500.000 USD</strong> còn lại để cải thiện tiếp cận nước sạch, vệ sinh môi trường và vệ sinh cá nhân (WASH), sửa chữa công trình vệ sinh, nâng cấp hệ thống chiếu sáng tại trường học, với mục tiêu hỗ trợ 20.000 người, trong đó có 14.000 trẻ em.\r\n\r\nĐại sứ Nhật Bản tại Việt Nam, ông ITO Naoki, nhấn mạnh: \"Chúng tôi hy vọng khoản viện trợ khẩn cấp này sẽ nhanh chóng đến tay người dân, giảm nhẹ hậu quả bão lũ và thúc đẩy phục hồi tại các khu vực bị ảnh hưởng. Nhật Bản cũng sẽ tiếp tục đẩy mạnh hợp tác kỹ thuật thông qua JICA, đặc biệt trong quản lý nước và phát triển hạ tầng tại miền Trung.\"\r\n\r\nNăm 2025, Việt Nam trải qua <strong>15 cơn bão và các trận lũ lịch sử</strong>, gây thiệt hại ước tính 3,6 tỉ USD. Bão Kalmaegi (6-11) khiến hơn 500.000 người phải sơ tán tạm thời. Tính đến cuối tháng 11, 409 người thiệt mạng hoặc mất tích, hơn 337.000 ngôi nhà bị phá hủy hoặc hư hỏng. Báo cáo mới nhất cho thấy khoảng 1,9 triệu người tại 9 tỉnh chưa tiếp cận được nước sạch và điều kiện vệ sinh an toàn.\r\n<figure><img title=\"Nhật Bản viện trợ 1 , 5 triệu USD hỗ trợ Việt Nam phục hồi sau thiên tai - Ảnh 3.\" src=\"https://nld.mediacdn.vn/thumb_w/698/291774122806476800/2025/12/15/dsc00016-17657912401161471813002.jpg\" alt=\"Nhật Bản viện trợ 1 , 5 triệu USD hỗ trợ Việt Nam phục hồi sau thiên tai - Ảnh 3.\" width=\"2560\" height=\"1706\" /><figcaption>Một gia đình tại xã Kim Cúc, tỉnh Cao Bằng được sử dụng nước sạch nhờ sự hỗ trợ của chính phủ Nhật Bản thông qua UNICEF.</figcaption></figure>\r\nĐại diện UNICEF tại Việt Nam, bà Silvia Danailov, cho biết: \"Trẻ em không gây ra biến đổi khí hậu, nhưng lại chịu ảnh hưởng nặng nề nhất. Nhờ hỗ trợ từ Nhật Bản, chúng tôi có thể cung cấp dịch vụ thiết yếu, bảo vệ trẻ em khỏi nguy cơ dịch bệnh và giúp cộng đồng tăng khả năng chống chịu.\"\r\n\r\nBà Kendra Rinas, Trưởng Phái đoàn IOM tại Việt Nam, nhấn mạnh vai trò của Nhật Bản trong việc nâng cao năng lực ứng phó thiên tai: \"IOM sẽ cung cấp bộ dụng cụ sửa chữa nhà ở, hàng hóa phi lương thực và trang bị thiết bị cứu nạn cho các đội phản ứng nhanh tại cộng đồng.\"\r\n\r\nTrước đó, trong năm 2024, Nhật Bản đã hỗ trợ Việt Nam ứng phó với bão Yagi, giúp gần 35.000 người dân tại các tỉnh miền núi phía Bắc tiếp cận nước sạch và dịch vụ bảo vệ trẻ em. IOM cũng xây dựng 6 nhà tránh trú cộng đồng, tạo nơi ở an toàn cho gần 1.000 người dân trong vùng nguy cơ cao.\r\n\r\nCả UNICEF và IOM đều cam kết tiếp tục hợp tác chặt chẽ với Chính phủ Việt Nam để hỗ trợ tái thiết sau thiên tai, đồng thời tăng cường khả năng phòng ngừa và ứng phó với các rủi ro khí hậu trong tương lai.', 'Việt Nam có nhận được 1,5 triệu USD viện trợ từ Nhật Bản để phục hồi sau thiên tai không?', 'Chính phủ Nhật Bản viện trợ khẩn cấp 1,5 triệu USD thông qua IOM và UNICEF nhằm hỗ trợ Việt Nam phục hồi sau thiên tai, tập trung vào các tỉnh miền Trung và Tây Nguyên chịu thiệt hại nặng nề.', 'publish', 'open', 'open', '', 'viet-nam-co-nhan-1-5-trieu-usd-vien-tro-nhat-ban-phuc-hoi-thien-tai', '', '', '2025-12-16 02:53:20', '2025-12-16 02:53:20', '', 0, 'http://localhost/tinbmt/?p=5280', 0, 'post', '', 0),
