(5291, 1, '2025-12-16 02:59:35', '2025-12-16 02:59:35', '<h1>Kẻ sát hại 4 người ở Đắk Lắk bị khởi tố thêm tội danh sử dụng trái phép vũ khí quân dụng</h1>\r\n(PLO)- Bị can sát hại bốn người trong gia đình ở Đắk Lắk bị khởi tố thêm tội danh sử dụng trái phép vũ khí quân dụng.\r\n\r\nNgày 16-12, thông tin từ VKSND tỉnh Đắk Lắk, cho biết đơn vị vừa phê chuẩn quyết định khởi tố thêm tội danh đối với Nguyễn Nam Đại Thuận, bị can đã sát hại bốn người trong một gia đình trên địa bàn.\r\n<figure><img id=\"2323454\" class=\"cms-photo\" title=\"Bị can Nguyễn Nam Đại Thuận. Ảnh: C.A\" src=\"https://image.plo.vn/w850/Uploaded/2025/crnwcqxjr/2025_09_13/nguyen-nam-dai-thuan-5586-8160.jpg.webp\" alt=\"Nguyễn Nam Đại Thuận.jpg\" data-width=\"960\" data-height=\"540\" data-image-id=\"2323454\" /><figcaption>Bị can Nguyễn Nam Đại Thuận. Ảnh: C.A</figcaption></figure>\r\nTrước đó, Nguyễn Nam Đại Thuận (37 tuổi, ngụ phường Ea Kao, Đắk Lắk), bị khởi tố các tội <strong>giết người</strong>, <strong>cướp tài sản</strong>.\r\n\r\nTheo VKSND tỉnh Đắk Lắk, ngày 13-9, Thuận sử dụng dao bầu xông vào nhà bà TTD đâm chết ba người và khiến một người bị thương.\r\n\r\nSau đó, Thuận cướp một điện thoại di động và 6 triệu đồng rồi bỏ trốn. Trên đường bỏ trốn, Thuận dùng dao khống chế, đe dọa tấn công, cướp xe máy và hai điện thoại di động của bà C (ngụ phường Buôn Ma Thuột).\r\n\r\nQuá trình điều tra, Cơ quan CSĐT Công an tỉnh Đắk Lắk xác định bị can Thuận sử dụng dao thuộc danh mục dao có tính sát thương cao để xâm phạm tính mạng, sức khỏe của người khác là hành vi sử dụng trái phép vũ khí quân dụng, đủ yếu tố cấu thành tội sử dụng trái phép vũ khí quân dụng theo Điều 304 Bộ luật Hình sự.\r\n\r\nTrên cơ sở đó, Cơ quan CSĐT Công an tỉnh Đắk Lắk đã ra quyết định bổ sung quyết định khởi tố bị can đối với Nguyễn Nam Đại Thuận về tội <strong>sử dụng trái phép vũ khí quân dụng</strong>.\r\n\r\n<em>Như PLO đã thông tin</em>, khoảng 2 giờ ngày 13-9, Nguyễn Nam Đại Thuận đến nhà chị Nguyễn Thị Kim H (32 tuổi, ngụ phường Thành Nhất) rồi dùng dao đâm chém liên tiếp vào các thành viên trong nhà chị H.\r\n\r\nHậu quả chị H, bà Trần Thị D (54 tuổi, mẹ chị H), anh Bùi Văn N (23 tuổi, em chị H) tử vong. Cháu Trần Tấn P (13 tuổi, con trai chị H) bị thương nặng.\r\n\r\nSau đó, Thuận cướp xe máy, cải trang thành phụ nữ để tẩu thoát nhưng bị bắt sau bốn giờ gây án.', 'Kẻ sát hại 4 người ở Đắk Lắk bị khởi tố thêm tội danh gì?', 'Nguyễn Nam Đại Thuận, kẻ sát hại 4 người trong một gia đình ở Đắk Lắk, vừa bị VKSND tỉnh phê chuẩn quyết định khởi tố bổ sung tội danh sử dụng trái phép vũ khí quân dụng. Trước đó Thuận đã bị khởi tố tội giết người và cướp tài sản.', 'publish', 'open', 'open', '', 'ke-sat-hai-4-nguoi-o-dak-lak-bi-khoi-to-them-toi-danh-gi', '', '', '2025-12-16 02:59:35', '2025-12-16 02:59:35', '', 0, 'http://localhost/tinbmt/?p=5291', 0, 'post', '', 0),
